import React, { useState, useEffect } from 'react';
import axios from 'axios';
import 'bootstrap/dist/css/bootstrap.min.css';
import { createUrl, log } from '../utils/utils';
import { toast } from 'react-toastify';
import { useNavigate } from 'react-router-dom';

const Admin = () => {
    const navigate = useNavigate();
    const [carBookings, setCarBookings] = useState([]);
    const [users, setUsers] = useState([]);
    const [cars, setCars] = useState([]);
    const [showAddCarForm, setShowAddCarForm] = useState(false);
    const [newCar, setNewCar] = useState({
        brandName: '',
        modelName: '',
        year: '',
        fuelType: '',
        price: '',
        color: '',
    });

    useEffect(() => {
        fetchCarBookings();
        fetchUsers();
        fetchCars();
    }, []);

    const fetchCarBookings = () => {
        // Fetch car bookings logic
    };

    const fetchUsers = () => {
        // Fetch users logic
    };

    const fetchCars = () => {
        // Fetch cars logic
    };

    const deleteSalesperson = (id) => {
        // Delete salesperson logic
    };

    const deleteCar = (id) => {
        // Delete car logic
    };

    const toggleAddCarForm = () => {
        setShowAddCarForm(!showAddCarForm);
    };

    const handleNewCarChange = (event) => {
        const { name, value } = event.target;
        setNewCar({
            ...newCar,
            [name]: value,
        });
    };

    const addNewCar = () => {
        const url = createUrl('/cars');
        axios
            .post(url, newCar)
            .then((res) => {
                toast.success('Car Added Successfully!');
                fetchCars();
                toggleAddCarForm();
                setNewCar({
                    brandName: '',
                    modelName: '',
                    year: '',
                    fuelType: '',
                    price: '',
                    color: '',
                });
            })
            .catch((error) => {
                log(error);
            });
    };

    const logout = () => {
        navigate('/');
    };

    return (
        <div className="container mt-5">
            <h1 className="text-center mb-4">Admin Dashboard</h1>

            {/* ... (car bookings table) */}

            {/* ... (users table) */}

            {/* ... (salesperson table) */}

            <div className="card mb-3">
                <div className="card-body">
                    <h5 className="card-title">Cars with Details</h5>
                    <table className="table">
                        {/* ... (table headers) */}
                        <tbody>
                            {showAddCarForm ? (
                                <tr>
                                    <td>
                                        <input
                                            type="text"
                                            name="brandName"
                                            value={newCar.brandName}
                                            onChange={handleNewCarChange}
                                            placeholder="Brand Name"
                                        />
                                    </td>
                                    <td>
                                        <input
                                            type="text"
                                            name="modelName"
                                            value={newCar.modelName}
                                            onChange={handleNewCarChange}
                                            placeholder="Model Name"
                                        />
                                    </td>
                                    <td>
                                        <input
                                            type="text"
                                            name="year"
                                            value={newCar.year}
                                            onChange={handleNewCarChange}
                                            placeholder="Year"
                                        />
                                    </td>
                                    <td>
                                        <input
                                            type="text"
                                            name="fuelType"
                                            value={newCar.fuelType}
                                            onChange={handleNewCarChange}
                                            placeholder="Fuel Type"
                                        />
                                    </td>
                                    <td>
                                        <input
                                            type="text"
                                            name="price"
                                            value={newCar.price}
                                            onChange={handleNewCarChange}
                                            placeholder="Price"
                                        />
                                    </td>
                                    <td>
                                        <input
                                            type="text"
                                            name="color"
                                            value={newCar.color}
                                            onChange={handleNewCarChange}
                                            placeholder="Color"
                                        />
                                    </td>
                                    <td>
                                        <button
                                            className="btn btn-outline-primary btn-sm"
                                            onClick={addNewCar}
                                        >
                                            Add Car
                                        </button>
                                        <button
                                            className="btn btn-outline-secondary btn-sm ml-2"
                                            onClick={toggleAddCarForm}
                                        >
                                            Cancel
                                        </button>
                                    </td>
                                </tr>
                            ) : (
                                <tr>
                                    <td colSpan="7">
                                        <button
                                            className="btn btn-outline-secondary btn-sm"
                                            onClick={toggleAddCarForm}
                                        >
                                            Add Car
                                        </button>
                                    </td>
                                </tr>
                            )}
                            {/* ... (existing cars table rows) */}
                        </tbody>
                    </table>
                </div>
            </div>

            <button className="btn btn-outline-danger btn-sm" onClick={logout}>
                Logout
            </button>
        </div>
    );
};

export default Admin;
